import React from 'react';
import { Switch, Route } from ''
import './App.css';
import 'bootstrap/dist/css/bootstrap.min.css'
import Navbar from './components/Navbar'


function App() {
  return (
    <div className="App">
      <Navbar />
      <Switch>
        <Route exact path="/" component={ProductList}></Route>
      </Switch>
    </div>
  );
}

export default App;
